static uint8_t tick(void) {
	static uint16_t a = 0;
	static uint16_t b = 0;

	uint8_t x, y;

	uint16_t sin1 = sini(a);
	float x0 = (float)sini(a*4)/256-64;
	float y0 = (float)sini((a*4)+0x1000)/256-64;
	float x1 = (float)sini(a*5)/128-128;
	float y1 = (float)sini((a*6)+0x1000)/128-128;
	for(y = 0; y < LED_HEIGHT; y++) 
	{


		uint16_t y_part =  sini(sin1+y*20);

		for(x = 0; x < LED_WIDTH; x++) 
		{
			float dist = pythagorasf(x0-x,y0-y);
			float dist2 = pythagorasf(y1-x,x1-y);


			uint16_t h = sini(sin1+x*20)+ y_part + sini(dist*500) + sini(dist2*300);
			uint16_t h2 = sini(sin1+x*30)+ y_part + sini(dist*200) + sini(dist2*350);


			//uint8_t r = sini((h>>2)+a*500)>>10;
			//uint8_t g = sini((h2>>2)+b*320+0x1555)>>10;
			//uint8_t b = sini((h>>2)+a*630+0x2aaa)>>10;

						setLedXY(
						x,y,
						sini((h>>2)+a*500)>>8,
						sini((h2>>2)+b*320+0x1555)>>8,
						sini((h>>2)+a*630+0x2aaa)>>8
						);
		}
	}



	for(y = 0; y < LED_HEIGHT; y++) 
	{
		for(x = 0; x < LED_WIDTH; x++) 
		{

			uint8_t r=0;
			uint8_t g=0;
			uint8_t b=0;
			
			getLedXY(x,y,&r,&g,&b);

			float fac = sini(a*50)/65535.0f; 

			if(image[y*128+x] == 1)
			{
				g = 255-(g/(1+(3*(1-fac))));
				r = fac*r;
				b = fac*b;
			}
			else
			{
				g = fac*g;
			}
			setLedXY(x,y,r,g,b);
		}
	}

	a+=1;
	if(a==0x4000)
	{
		a=0;
	}
	b+=2;
	if(b==0x4000)
	{
		b=0;
	}
	return 0;
}

